description:
Lately, it seems like there is a protest every day of the week. Many of us have attended one.  As they get bigger and more popular the issue of safety for those participating has become a concern. This interactive training is designed to equip participants with the essential skills needed to engage in dialogue and manage conflict during potential tense and emotional circumstances. This training will focus on empathy, reflective listening, self-regulation, safety measures, and role play scenarios.

Our presenters will be: Jill Murphy (Friends of Bernie Sanders);
Erik Shelley (Michigan United Action); Lisa Denny (UNDIVIDED) and Stephanie Crider (UNDIVIDED)

We will have signs and either march across the Ford Bridge or stand on Ford Parkway proclaiming:   WE REMEMBER WHEN: 
•	truth mattered and our leaders could be trusted 
•	our loyalty was to our Constitution, not our President; 
•	due process was available for all, be they a citizen or not; 
•	our higher education institutions and research programs were strongly supported; 
•	we had programs to help those in need, including Veterans, Seniors, Disabled Persons, Disaster Victims, Low-income Families, WIC, Food Stamps, Head Start;
•	our lands and waters were protected for all;
•	there was acceptance and support of all beliefs; 
•	we worked closely with our allies around the world and honored previous collaborations.
